import React, { useState, useEffect } from 'react';

const Home = () => {
  const [personData, setPersonData] = useState({});
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Aquí debes reemplazar la URL con la API real de donde obtendrás los datos de la persona.
    fetch('https://api.example.com/person')
      .then((response) => response.json())
      .then((data) => {
        setPersonData(data);
        setIsLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
        setIsLoading(false);
      });
  }, []);

  return (
    <div>
      <h1>Información de la Persona</h1>
      {isLoading ? (
        <p>Cargando...</p>
      ) : (
        <div>
          <img src={personData.image} alt={`Imagen de ${personData.nombre}`} />
          <p>Nombre: {personData.nombre}</p>
          <p>Apellido: {personData.apellido}</p>
        </div>
      )}
    </div>
  );
};

export default Home;
